// Gallery.js
import React from 'react';

function Gallery() {
  // 12 foto urut dari 1.jpeg sampai 12.jpeg
  const images = Array.from({length: 12}, (_, i) => `/assets/images/${i+1}.jpeg`);
  return (
    <section style={{margin: '2rem 0'}}>
      <h2>Galeri Kenangan</h2>
      <div style={{
        display: 'flex',
        gap: 16,
        flexWrap: 'wrap',
        justifyContent: 'center',
        marginTop: 24
      }}>
        {images.map((src, i) => (
          <img
            key={i}
            src={src}
            alt={`Kenangan ${i+1}`}
            style={{
              width: 120,
              height: 120,
              objectFit: 'cover',
              borderRadius: 8,
              background: '#333',
              boxShadow: '0 2px 8px rgba(0,0,0,0.12)'
            }}
          />
        ))}
      </div>
    </section>
  );
}

export default Gallery;
